def test(base, target):
    decoded_data = base64.b64decode(base)
    np_data = np.frombuffer(decoded_data, np.uint8)
    base = cv2.imdecode(np_data, cv2.IMREAD_UNCHANGED)
    base = cv2.cvtColor(base, cv2.COLOR_BGRA2RGB)

    decoded_data = base64.b64decode(target)
    np_data = np.frombuffer(decoded_data, np.uint8)
    target = cv2.imdecode(np_data, cv2.IMREAD_UNCHANGED)
    target = cv2.cvtColor(target, cv2.COLOR_BGRA2RGB)

    # do some manipulation
    im1Gray = cv2.cvtColor(base, cv2.COLOR_RGB2GRAY)
    im2Gray = cv2.cvtColor(target, cv2.COLOR_RGB2GRAY)

    MAX_FEATURES = 5000
    # 确定要查找的最大关键点数
    
    orb = cv2.ORB_create(MAX_FEATURES)
    
    # detect特征点、计算描述子
    kp1 = orb.detect(im1Gray)
    kp1, des1 = orb.compute(im1Gray, kp1)
    kp2 = orb.detect(im2Gray)
    kp2, des2 = orb.compute(im2Gray, kp2)
    # 目前是暴力匹配
    # 交叉匹配则在后加True参数
    matcher = cv2.BFMatcher_create(cv2.NORM_HAMMING) # 返回两个测试对象之间的汉明距离
    matches = matcher.match(des1, des2)
    # 按相近程度排序
    matches = sorted(matches, key=lambda x: x.distance)

    src_pts = np.float32([kp1[m.queryIdx].pt for m in matches])
    dst_pts = np.float32([kp2[m.trainIdx].pt for m in matches])
    # 单应性矩阵计算
    M, _ = cv2.findHomography(src_pts, dst_pts, cv2.RANSAC, 0.5)
    im_mask = np.ones_like(base, dtype=np.uint8)
    h, w = im2Gray.shape
    # print(im2Gray.shape)
    #im1Reg = cv2.warpPerspective(im2Gray, M, (w, h))

    baseReg: np.ndarray= cv2.warpPerspective(base, M, (w, h))
    imMask = cv2.warpPerspective(im_mask, M, (w, h))

    # img_gray = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
    pil_im = Image.fromarray(baseReg)

    buff = io.BytesIO()

    pil_im.save(buff, format="PNG")
    img_str = base64.b64encode(buff.getvalue())
    return ""+str(img_str, 'utf-8')

if __name__ == "__main__":
    test(data, data_)
